import React, { Component } from 'react';
import Game from './components/Game'
import './App.css';
import * as data from './store/tasks.json'
import * as action from './store/actions.js'

class App extends Component {

    componentDidMount() {
        action.save();
    }

    render() {
        return (
            <div className='body'>
                <h1>{action.getTasks()[0].id}</h1>
                
                <Game />
            </div>
        );
    }
}

export default App;
